import React from 'react'
const informations = [
    {
        date: "2020-01-12",
        institute: { name: "NCIT", location: "Lalitpur", university: "Pokhara University" }
    }
]
function Academic() {
    return (
        <div className="academic">

            <div>
                <h1>Academic</h1>
            </div>

            <div className="line"></div>

            <div className="institutes">
                {
                    informations.map(info => {

                        return (
                            <>
                                <div className="date">
                                    <strong>2019-Ongoing</strong>
                                </div>
                                <div className="institute">
                                    <blockquote>
                                        Master in Computer Engineering
                    </blockquote>
                                    <pre>
                                        NCIT, Lalitpur
                    </pre>
                                    <tt>
                                        Pokhara University
                    </tt>

                                </div>
                            </>
                        )
                    })
                }

            </div>

        </div>
    )
}

export default Academic
